void mainImage( out vec4 fragColor, in vec2 fragCoord ) {

    fragCoord -= 0.5*iResolution.xy;
    fragCoord.y *= -1.0;

	float zoom = max(floor(iResolution.y / 144.), 1.);
    fragCoord /= zoom;

    ivec2 fc = ivec2(floor(fragCoord));
    fc += ivec2(80, 72);

    int brt;

    if (fc.x < 0 || fc.y < 0 || fc.x >= 160 || fc.y >= 144) {

        brt = 1;

    } else {

        int sample_idx = fc.y * 160 + fc.x;
        int texel_idx = sample_idx / 60;
        int within_idx = sample_idx % 60;

        ivec2 tpos = ivec2(texel_idx & 31, texel_idx >> 5);
        vec4 v = texelFetch(iChannel0, tpos, 0);

        int word_idx = within_idx / 15;
        int twobit_idx = within_idx % 15;

        float s = v[word_idx];
        uint k = floatBitsToUint(s);
        brt = int( (k >> (twobit_idx*2)) & 0x3u );

    }

    ivec3 c = (brt == 0 ? ivec3(15,56,15) :
               brt == 1 ? ivec3(48,98,48) : 
               brt == 2 ? ivec3(139,172,16) :
               ivec3(165, 198,15));

    fragColor = vec4(vec3(c)/255., 1); 

}

